style.css:
@-moz-document domain(intra.konyaalti.local) {

.xv-node {
    background: black;
    font-size: medium;
}

.xv-attr-value {
    color: #02f23c;
}

.xv-attr {
    color: rgba(112, 109, 109, 0.66);
    position: relative;
}

.xv-tag-name {
    color: #fbf0c391;
    /* background-color: rgb(244, 250, 255); */
}

.xv-attr-name {
    color: #4f9fcfcc;
}

.xv-one-line > .xv-comment-value, .xv-one-line > .xv-cdata-value {
color: white;
}

.xv-outline-node {
    background: #000000;
}

.xv-outline-node-inner {
color: #caab58;
    font-size: small;
}

.xv-outline-tag-name {
    color: #005082;
    text-shadow: 0px 1px 0 rgba(8, 0, 0, 0.6);
    color: #01bc2d;
}

}
